import React, {useState} from 'react';
import logo from './logo.svg';
import './App.css';

import Header from "./component/Header";


function App() {
  let [data, dataSet] = useState([
    {title: '제목', article: '게시내용', dateTime: '2020/12/25 00:00:00'}
  ]);

  return (
    <div className="App">
      <div className="lists">
        <h3>{ data[0].title }</h3>
        <p>{ data[0].dateTime }</p>
        <p>{ data[0].article }</p>
        <hr />
      </div>
    </div>
  );
}

export default App;
